INSERT INTO `cdata_notice` VALUES ('1','2','','                      赏樱花\r\n\r\n时间：2018/3/24 上午\r\n地点：上野公园\r\n\r\n集合地点：上野站中央出口\r\n集合时间：8点\r\n\r\n活动详细：\r\n  8-11点:赏花喝酒\r\n\r\n注意事项：\r\n  各自注意安全，开心出游','系统超级管理员','2018-03-03 20:11:39','0'),('10','2','','新规中日旅游服务提案讨论\r\n日时:2018年3月23日 周五 19:30\r\n场所:新宿本社\r\n内容:\r\n5月26日由大连市政府，大连旅游局主办邀请日本政府，日本企业在大连举办中日经济交流峰会，届时日本政府红人二階 俊博率领ANA集团，日本观光厅到大连针对中日旅游进行交流。咱公司有幸争取到一个发表时间，会在这个时间段里提案一个中日旅游服务平台。\r\n目前提案资料的雏形已经做好，需要得到大家的建议，一次修改后会向日本咨询专家进行二次，三次review。\r\n希望大家踊跃参加，给出宝贵意见。\r\n\r\n另，会对周五来公司的小伙伴提供晚饭。','李滕锋','2018-03-19 09:59:09','0'),('11','1','','经费报销模块上线，暂时只支持交通费精算书做成，使用陈桑当时发送在群里的模版。\r\n模块使用说明：\r\n入口在 【个人-经费报销】\r\n录入费用之后，点击页面中邮件小图标，可发送精算书到指定邮箱。\r\n\r\n关于邮箱地址：\r\n在个人资料里面可录入个人邮箱地址，则会作为默认地址显示在收件地址栏中。\r\n\r\n发现BUG或有兴趣参与开发e-work系统开发的同事联系郑或房。\r\n','系统超级管理员','2018-03-28 00:26:26','0'),('2','1','','月底请提交个人勤务报告表。\r\n发送至邮箱xxx@bridge.co.jp','系统超级管理员','2018-03-03 20:13:10','0'),('3','2','','                      赏樱花\r\n\r\n时间：2018/3/24 上午\r\n地点：上野公园\r\n\r\n集合地点：上野站中央出口\r\n集合时间：8点\r\n\r\n活动详细：\r\n  8-11点:赏花喝酒\r\n\r\n注意事项：\r\n  各自注意安全，开心出游\r\n\r\n以上纯属虚构','系统超级管理员','2018-03-03 20:18:32','0'),('4','1','','月底请提交个人勤务报告表。\r\n发送至邮箱xxx@bridge.co.jp','系统超级管理员','2018-03-04 01:48:23','0'),('5','1','','测试\r\n请大家准时填写出勤时间。\r\n发送至邮箱xxx@bridge.co.jp','管理员','2018-03-04 17:03:07','0'),('6','2','','                      赏樱花（）\r\n\r\n时间：2018/3/24 上午\r\n地点：上野公园\r\n\r\n集合地点：上野站中央出口\r\n集合时间：8点\r\n\r\n活动详细：\r\n  8-11点:赏花喝酒\r\n\r\n注意事项：\r\n  各自注意安全，开心出游\r\n\r\n以上纯属虚构','管理员','2018-03-04 17:03:20','0'),('7','1','','请大家在这周五(3/9)前使用管理员用户自助完成注册，3/9之后将不再公开管理员账号密码，统一由管理员负责追加用户。\r\n\r\n管理员信息\r\n账号：admin\r\n密码：admin\r\n\r\n发现BUG或有兴趣参与开发e-work系统开发的同事联系郑或房。\r\n','系统超级管理员','2018-03-07 19:33:00','0'),('8','2','','目前木有活动。','系统超级管理员','2018-03-07 19:34:30','0'),('9','1','','大家都已完成注册，不再公布管理员账号信息。\r\n\r\n需要追加用户，初始化密码等请联系下列管理员权限人员\r\n李桑、陈桑\r\n\r\n发现BUG或有兴趣参与开发e-work系统开发的同事联系郑或房。\r\n','管理员','2018-03-08 23:46:46','0');
